__device__
inline int getModOf6Power(int base, int mod){
    int exp = 6;
    int res = 1;
    while (exp > 0) {
       if (exp % 2 == 1)
          res= (res * base) % mod;
       exp = exp >> 1;
       base = (base * base) % mod;
    }
    return res;

}


__device__
int getLeftModSubIn3Numbers(int prime, int a, int b, int c){
    int result = getModOf6Power(a, prime) - getModOf6Power(b, prime) - getModOf6Power(c, prime);
    while (result < 0){
        result += prime;
    }
    return result;
}
